actionConfiguration.body:
() => {
  switch (appsmith.store.level) {
    case 'artist':
      JS_global_mobile.query_artists(appsmith.store.collection_id);
      break;
    case 'album':
      JS_global_mobile.query_albums(appsmith.store.collection_id, dynamic_table.selectedRow.artist_id);
      break;
    case 'track':
      JS_global_mobile.query_tracks(appsmith.store.collection_id, dynamic_table.selectedRow.album_id);
      break;
  }
}

